Você já pensou na mensagem que passa para si mesma quando você se coloca sempre por último?

Veja as consequências de ir "levando" e vivendo no automático:

1️⃣ Cansaço que não passa, mesmo dormindo (quando dorme);

2️⃣ Irritação com coisas pequenas e atritos nas relações (profissionais e pessoais);

3️⃣ Sensação constante de sobrecarga, mesmo "repousando";

4️⃣ Dificuldade de decidir o que realmente quer (Quem é você?);

5️⃣ Desconexão do próprio corpo (só para quando o corpo para);

6️⃣ Ansiedade silenciosa;

7️⃣ Perda de entusiasmo pelo que antes fazia sentido;

8️⃣ Sensação de estar vivendo no automático (não sente a vida e as coisas verdadeiramente);

9️⃣ Ressentimento por sustentar tudo sozinha (e se sentir sozinha);

🔟 Confusão sobre quem você está se tornando;

Se deixar para depois parece responsabilidade, compromisso, entrega.. 
Mas muitas vezes é abandono disfarçado de força.

 A pergunta não é “quando vai dar tempo?”

É: quanto mais você quer pagar esse preço?

